INSERT INTO `brands` (`id`, `title`, `slug`, `img`, `description`, `created_at`, `updated_at`) VALUES
(8, 'acana', 'acana', '/photos/shares/5db3344960ff8.png', 'Мы готовим Биологически Соответствущие™ корма для собак и кошек из Свежих Канадских Ингредиентов и мы готовим их от начала и до конца на наших собственных, отмеченных наградами, кухнях.   Наша миссия представляет Вам новый класс корма, который отвечает всем критериям природного питания собак и кошек, адаптированных к мясному рациону питания с высоким содержанием белка. Вот почему, мы фокусируем внимание на непревзойденных ингредиентах, выращенных и выловленных в Канаде, доставляемых на кухни свежими каждый день.    Мы думаем, Вы полюбите корм ACANA, но что еще более важно, его полюбит Ваш питомец.', '2019-10-25 14:44:40', '2019-10-25 14:44:40'),
(9, 'advantix', 'advantix', '/photos/shares/5db334b5847a5.png', 'Этот бренд имеет мировое признание и высокую востребованность. Такую популярность торговая марка обрела благодаря множеству достоинств: безупречному качеству товаров, высокой эффективности препаратов, полной гарантии защиты, максимально быстрому воздействию, длительному действию средств, простому использованию препаратов, отсутствию противопоказаний. Капли от блох, клещей и вшей «Адвантикс» изготавливаются исключительно из высококачественных препаратов с применением современного оборудования и инновационных методов. Такой серьезный подход к делу обеспечивает высочайший уровень надежности и безопасности продукции. Благодаря подобным средствам ваши прогулки с питомцем на природе будут приносить только положительные яркие эмоции, а не проблемы с кровососущими паразитами.', '2019-10-25 14:49:18', '2019-10-25 14:49:18'),
(10, 'brit', 'brit', '/photos/shares/5db335cbbe090.png', 'Потребности домашних животных изменяются в процессе их развития и взросления. Поэтому это должно обязательно учитываться в продуктах питания воспитанников. Всем требованиям питомцев на разных этапах их жизни отвечает продукция Brit. Компания была основана в Чехии в 1994 году и представляет собой образец того, как любовь и забота о домашних животных одной семьи может превратиться в предприятие мирового масштаба. Начиная с производства небольших линеек здорового питания, торговая марка со временем достигает больших высот, и сейчас она поставляет на международный рынок огромный ассортимент полноценных влажных и сухих кормов премиум и суперпремиум класса как для кошек, так и для собак.', '2019-10-25 14:56:47', '2019-10-31 13:42:44'),
(11, 'optimeal', 'optimeal', '/photos/shares/5db337fdc9833.png', 'Данный бренд - это молодой украинский производитель сухих кормов премиум класса для кошек и собак. Торговая марка была создана в 2005 году под руководством компании KORMOTECH, которая считается лидером украинского рынка готовых кормов для домашних животных. Изначально торговая марка специализировалась на разработке и производстве только сухих кормов, но в скором времени границы деятельности значительно расширились, и компания начинает заниматься изготовлением консервов для собак и кошек. Благодаря инновационному подходу к работе и сотрудничеству с известными компаниями данный бренд очень быстро вышла на международный уровень. Сегодня продукция бренда продается более чем в 20 странах мира, активно покоряя просторы европейского рынка. Торговой марке доверяют не только обычные владельцы домашних животных, она успела завоевать доверие опытных ветеринаров и специалистов. Поэтому продукты питания неоднократно получали различные награды и сертификаты качества. Сегодня бренд считается одним из самых перспективных и конкурентоспособных в Украине, на него возлагают большие надежды.  Источник: https://zoomisto.com.ua/brands/optimeal', '2019-10-25 15:00:38', '2019-10-25 15:00:38'),
(12, 'orijen', 'orijen', '/photos/shares/5db338a0dd73c.png', 'Канадский бренд кормов для домашних питомцев Orijen представлен на рынке уже более 30 лет. За это время производители смогли завоевать расположение владельцев котов и собак. Популярность корма Orijen обусловлена использованием качественных ингредиентов и инновационных технологий, позволяющих добиться максимальной пользы от питания.  У бренда Orijen есть своя философия создания продукции, которая во многом отражает традиции местных фермеров. Она гласит, что любой корм для кота или собаки должен соответствовать биологическому виду животного и содержать все необходимые ему витамины и минералы.', '2019-10-25 15:02:14', '2019-10-25 15:02:14'),
(13, '1stchoice', '1stchoice', '/photos/shares/5db3331370993.png', '1st CHOICE - это сбалансированные канадские корма суперпремиум класса для кошек и собак, изготовленные из ингредиентов высшего качества.', '2019-10-25 15:07:04', '2019-10-25 15:07:04'),
(15, 'royalcanin', 'royalcanin', '/photos/shares/5db33a942f738.png', 'Royal Canin — Французский производитель кормов для кошек и собак, с 2002 года принадлежащий подразделению компании Mars, Incorporated «Masterfood». Фирма «Royal Canin» была основана в 1967 году в местечке Гард (Франция). Нынче, главный офис размещается в городе Эмарг (Франция).  Компания «Royal Canin» имеет представительства в разных странах: США, Аргентине, Бразилии, Германии, России и Канаде. Компания «Royal Canin» также известна своими разработками в области сбалансированного питания кошек и собак, основанными на производстве кормов для животных с различными особенностями: пожилой возраст, длинная шерсть, уход за кожей, образ жизни (подвижность).', '2019-10-25 15:11:09', '2019-10-25 15:11:09'),
(17, 'trixie', 'trixie', '/photos/shares/5db33b56ca5dd.png', 'Компания TRIXIE (Трикси) была основана Бонником Ханзеном.Предприятие снабжает около 5000 крупных оптовых клиентов только в Германии, а также бесчисленное количество магазинов по всему миру. Ассортиментный ряд Трикси насчитывает более 5500 наименований товаров для собак, кошек, птиц, мелких животных и рыб.Компания TRIXIE экспортирует свою продукцию в более чем 60 стран. Общее обслуживание и выполнение заказов происходит из главного офиса в городе Tarp.', '2019-10-25 15:14:59', '2019-10-25 15:14:59'),
(18, 'purina', 'purina', '/photos/shares/5db801c4721cc.jpg', 'Бренд Purina, объединяющий сухие корма для собак и кошек, принадлежит огромному швейцарскому концерну Nestle («Нестле») — известному во всём мире пищевому гиганту, производящему не только напитки и продукты питания для людей, но и готовые корма для домашних питомцев. Компания Nestle в 2016-м году отмечает свой 150-летний юбилей, а в России продукция этой крупной фирмы представлена с конца XIX века.  Часть продукции для животных компания производит на территории России, а некоторые корма поставляются с европейских заводов.', '2019-10-29 07:09:37', '2019-10-29 07:09:37'),
(19, 'hills', 'hills', '/photos/shares/5db80614aaf06.jpg', 'Hill\'s — корма для домашних питомцев суперпремиум класса. В линейке товаров как повседневное питание для здоровых животных, так и лечебные корма для собак и кошек, страдающих различными заболеваниями. Бренд Hill’s принадлежит компании Hill\'s Pet Nutrition, которая, в свою очередь, является дочерним предприятием компании Colgate—Palmolive Company.', '2019-10-29 07:27:58', '2019-10-29 07:27:58'),
(20, 'прочее', 'drugoe', NULL, NULL, '2019-10-29 13:36:05', '2019-10-29 13:36:05');
