(1, 12, 18, 'Purina (Пурина) Veterinary Diets HA Hypo Allergenic Canine Formula лечебный сухой корм для взрослых собак c аллергией', 'purina-purina-veterinary-diets-ha-hypo-allergenic-canine-formula-lechebnyy-sukhoy-korm-dlya-vzroslykh-sobak-c-allergiey', '<p>Сухой лечебный (гипоаллергенный) корм для щенков и взрослых собак для снижения пищевой непереносимости, с отобранными источниками белка и углеводов.</p>', 870.00, 0.00, '3 кг.', 11, 1, '/photos/shares/5db7fe07293b2.jpg', 0, '1996-07-12 15:02:30', '2019-10-29 07:10:30'),
(2, 27, 19, 'Hills Prescription Diet Weight Reduction r/d Chicken Лечебный корм для снижения веса у кошек', 'hills-prescription-diet-weight-reduction-rd-chicken-lechebnyy-korm-dlya-snizheniya-vesa-u-koshek', '<p>Сухой лечебный корм&nbsp;Hills Prescription Diet Weight Reduction r/d Chicken для снижения веса без вреда для здоровья всего за 8 недель.</p>', 472.00, 0.00, '1,5 кг.', 4, 1, '/photos/shares/5db8090a96aa1.jpg', 0, '1986-06-29 14:36:53', '2019-10-29 07:40:34'),
(3, 26, 15, 'Royal Canin Neutered Weight Balance влажный корм консерва для котов и кошек с момента стерилизации и до 7 лет, склонных к избыточному весу (пауч)', 'royal-canin-neutered-weight-balance-vlazhnyy-korm-konserva-dlya-kotov-i-koshek-s-momenta-sterilizatsii-i-do-7-let-sklonnykh-k-izbytochnomu-vesu-pauch', '<p>Консервы Роял канин для кастрированных / стерилизованных котов и кошек с момента операции до 7 лет, склонных к избыточному весу.</p>', 28.00, 30.00, '100 гр.', 150, 1, '/photos/shares/5db8265a2267c.jpg', 1, '1973-09-14 17:26:08', '2019-10-29 09:46:04'),
(4, 11, 10, 'Brit Pate & Meat Venison Консервы Брит кусочки оленины в паштете для собак', 'brit-pate-meat-venison-konservy-brit-kusochki-oleniny-v-pashtete-dlya-sobak', '<p>Высокое содержание качественного мяса и его щадящая обработка являются гарантией отличного вкуса и запаха. Аппетитное сочетание настоящих кусочков мяса и мясных субпродуктов в паштете удовлетворит вкусы даже самых требовательных собак-гурманов.</p>', 62.00, 70.00, '400 гр.', 5, 1, '/photos/shares/5db7f80e5f2ce.jpg', 1, '2002-05-01 21:09:11', '2019-10-29 06:28:24'),
(5, 12, 15, 'Royal Canin Satiety Small Dog SSD30 Лечебный корм для собак мелких пород при ожирении, избыточном весе', 'royal-canin-satiety-small-dog-ssd30-lechebnyy-korm-dlya-sobak-melkikh-porod-pri-ozhirenii-izbytochnom-vese', '<p>Ветеринарная диета для собак мелких пород весом менее 10 кг. Показания к применению:ожирение; избыточный вес; сахарный диабет (при избыточном весе); гиперлипидемия при избыточном весе; поддержание веса в пределах нормы.</p>', 398.00, 0.00, '1,5 кг.', 4, 1, '/photos/shares/5db824c97fa81.jpg', 0, '1982-07-27 16:20:05', '2019-10-29 09:39:16'),
(6, 25, 8, 'Acana Grasslands СAT & KITTEN, сухой корм холистик с ягненком и уткой для кошек для котят всех пород и возрастов', 'acana-grasslands-sat-kitten-sukhoy-korm-kholistik-s-yagnenkom-i-utkoy-dlya-koshek-dlya-kotyat-vsekh-porod-i-vozrastov', '<p><em>Акана</em>&nbsp;GRASSLANDS СAT &amp; KITTEN - полноценный и сбалансированный корм из свежих Канадских ингредиентов для кошек всех пород и возрастов</p>\r\n\r\n<p>65% животных ингредиентов<br />\r\n35% фруктов и овощей<br />\r\n0% зерновых (беззерновой)<br />\r\nвключает&nbsp; четыре вида свежего протеина.</p>', 2033.00, 0.00, '5,4 кг.', 0, 1, '/photos/shares/5db711bc9352b.jpg', 1, '2004-08-21 13:44:58', '2019-10-28 14:47:26'),
(7, 27, 18, 'Purina (Пурина) Veterinary Diets HA Hypo Allergenic Feline Formula лечебный диетический сухой корм для взрослых кошек при аллергии', 'purina-purina-veterinary-diets-ha-hypo-allergenic-feline-formula-lechebnyy-dieticheskiy-sukhoy-korm-dlya-vzroslykh-koshek-pri-allergii', '<p>Purina Diets HA Hypo Allergenic - сухой полнорационный, сбалансированный и диетический корм для кошек для снижения пищевой непереносимости, с отобранными источниками белка и углеводов.</p>', 173.00, 0.00, '325 гр.', 5, 1, '/photos/shares/5db804b234d1f.jpg', 1, '1993-12-13 08:45:09', '2019-10-29 07:24:46'),
(8, 12, 19, 'Hills Prescription Diet Canine i/d Low Fat Лечебный сухой корм для собак Желудочно-кишечные заболевания, некоторые виды панкреатита', 'hills-prescription-diet-canine-id-low-fat-lechebnyy-sukhoy-korm-dlya-sobak-zheludochno-kishechnye-zabolevaniya-nekotorye-vidy-pankreatita', '<p>Низкокалорийный полноценный диетический корм при острых кишечных абсорбативных расстройствах для компенсации дефицита питательных веществ, при нарушеном пищеварении и хронических расстройствах поддающихся коррекции с помощью рациона с низким содержанием жира.</p>', 456.00, 0.00, '1,5 кг.', 6, 1, '/photos/shares/5db807ad9408c.jpg', 0, '1991-07-05 06:57:56', '2019-10-29 07:35:00'),
(9, 26, 10, 'Brit Care Cat (пауч) Кусочки в соусе с КУРИЦЕЙ и СЫРОМ для кошек', 'brit-care-cat-pauch-kusochki-v-souse-s-kuritsey-i-syrom-dlya-koshek', '<p>Консервированный корм для взрослых кошек с курицей и сыром в соусе. Состоит из натуральных&nbsp;не провоцирующих аллергические реакции и высокой усвояемостью продуктов, которые не вызывают пищевую непереносимость. Brit Care поддерживает внутреннюю среду организма на постоянном уровне.</p>', 44.00, 0.00, '80 гр.', 8, 1, '/photos/shares/5db7faed84cfb.jpg', 0, '1999-05-01 10:19:05', '2019-10-29 06:41:38'),
(10, 12, 15, 'Royal Canin Renal Select RSE12 Dog Лечебный корм для собак для поддержания функции почек при острой или хронической почечной недостаточности', 'royal-canin-renal-select-rse12-dog-lechebnyy-korm-dlya-sobak-dlya-podderzhaniya-funktsii-pochek-pri-ostroy-ili-khronicheskoy-pochechnoy-nedostatochnosti', '<p>Полнорационный диетический корм для собак:&nbsp;<br />\r\n- для поддержания функции почек при острой или хронической почечной недостаточности благодаря пониженному содержанию фосфора и высококачественным белкам.<br />\r\n- способствует профилактике оксалатного уролитиаза благодаря низкому содержанию кальция и витамина D и повышенной способности к защелачиванию мочи.</p>', 451.00, 0.00, '2 кг.', 5, 1, '/photos/shares/5db822f193b8f.jpg', 1, '1985-11-12 14:17:14', '2019-10-29 09:31:07'),
(11, 26, 10, 'Brit Care Cat (пауч) Кусочки в соусе с КУРИЦЕЙ и СЫРОМ для котят', 'brit-care-cat-pauch-kusochki-v-souse-s-kuritsey-i-syrom-dlya-kotyat', '<p>Консервированный суперпремиум корм для котят с 1 до 12 месяцев с курицей и сыром в соусе. Состоит из натуральных&nbsp;не провоцирующих аллергические реакции и высокой усвояемостью продуктов, которые не вызывают пищевую непереносимость. Brit Care поддерживает внутреннюю среду организма на постоянном уровне.</p>', 44.00, 0.00, '80 гр.', 9, 1, '/photos/shares/5db7faeda79f9.jpg', 0, '2000-05-08 09:54:33', '2019-11-02 14:27:18'),
(12, 26, 10, 'Brit Premium Fillets in Gravy for Adult Cats (пауч) Консервы для кошек Кусочки в соусе из филе: курицы, говядины, индейки, лосося или тунца', 'brit-premium-fillets-in-gravy-for-adult-cats-pauch-konservy-dlya-koshek-kusochki-v-souse-iz-file-kuritsy-govyadiny-indeyki-lososya-ili-tuntsa', '<p>Полнорационный влажный корм премиум-класса Брит для взрослых кошек (от 1 до 7 лет). На выбор кусочки из филе в соусе: говядина, курица, индейка, лосось или тунец.&nbsp;Состоит из натуральных продуктов, которые не вызывают пищевую непереносимость. Обеспечивает организм животного необходимым количеством питательных веществ, витаминов и микроэлементов, что способствует активизации обмена веществ, улучшению аппетита.</p>', 20.00, 22.00, '85 гр.', 220, 1, '/photos/shares/5db7f92e56c0b.jpg', 1, '2000-10-07 19:24:02', '2019-10-29 06:36:03'),
