(71, 14, 17, 'Сумка-контейнер для хранения сухого корма, Trixie TX-2466', 'sumka-konteyner-dlya-khraneniya-sukhogo-korma-trixie-tx-2466', '<p>Прекрасная сумка-контейнер для хранения сухого корма. Благодаря регулируемому по длине ремню сумку удобно нести через плечо либо подвесить, если она не используется. Сумка надежно застегивается на &quot;молнию&quot;, что препятствует выветриванию запаха корма.&nbsp;TX-24661&nbsp;- 35 см/29 см, вместимость около 10 кг сухого корма</p>\r\n\r\n<p>&nbsp;</p>', 232.00, NULL, 'на 10 кг.', 5, 1, '/photos/shares/5db83589b9ade.jpg', 0, '2019-10-29 11:00:59', '2019-10-29 11:00:59'),
(72, 23, 17, 'Автомобильная подстилка в багажник для собак Trixie TX-1314', 'avtomobilnaya-podstilka-v-bagazhnik-dlya-sobak-trixie-tx-1314', '<p>Защищает багажник автомобиля от шерсти собаки и грязи.&nbsp; Имеет специальный клапан для защиты бампера машины от царапин когтей собаки (крепится к подстилке на липучках). Вшиты металлические направляющие для сохранения формы в багажнике.&nbsp;Размеры подстилки: 1,64х1,25 м. Цвет: черный.</p>', 1010.00, NULL, 'шт.', 2, 1, '/photos/shares/5db83589c86fd.jpg', 0, '2019-10-29 11:02:56', '2019-10-29 12:14:50'),
(73, 23, 17, 'Гамак для собак в машину Трикси 1324', 'gamak-dlya-sobak-v-mashinu-triksi-1324', '<p><strong>Чехол для автосидений Trixie 1324</strong>&nbsp;изготовлен из нейлона, защищает обивку автомобиля от грязи и шерсти животных. Легко расстилается и крепится к подголовникам, водонепроницаем. Стирка при 30 &deg;C.&nbsp;&nbsp;<strong>Размер: 1,45м х 1,60м</strong></p>', 930.00, NULL, 'шт.', 2, 1, '/photos/shares/5db83589bd420.jpg', 0, '2019-10-29 11:04:23', '2019-10-29 12:16:10'),
(74, 23, 17, 'Нейлоновое полотно для багажника Trixie TX-1318', 'neylonovoe-polotno-dlya-bagazhnika-trixie-tx-1318', '<p>Это полотно - подходящая защита обивки для всей ЛЕГКОВОЙ МАШИНЫ. Оно защищает багажник или салон автомобиля от грязи и шерсти животных.&nbsp;</p>', 550.00, 600.00, 'шт.', 15, 1, '/photos/shares/5db8358a13329.jpg', 0, '2019-10-29 11:06:06', '2019-10-29 12:15:58'),
(75, 20, 17, 'Мяч-радуга на веревке, Trixie TX-330', 'myach-raduga-na-verevke-trixie-tx-330', '<p>TX-3304&nbsp;размер: диаметр мячика -&nbsp;5см, длина каната - 1 м.</p>\r\n\r\n<p>TX-3305&nbsp;размер: диаметр мячика -&nbsp;6см, длина каната - 30см.</p>', 65.00, NULL, 'шт.', 10, 1, '/photos/shares/5db839d152779.jpg', 0, '2019-10-29 11:09:18', '2019-10-29 12:15:47'),
