(89, 18, 17, 'Колтунорез прямой Trixie TX-2403', 'koltunorez-pryamoy-trixie-tx-2403', '<p>Этот колтунорез для собак и кошек может использоваться для того, чтобы удалить спутанные комки шерсти (колтуны), не причиняя боль животному</p>', 150.00, NULL, 'шт.', 23, 1, '/photos/shares/5db84d18e856d.jpg', 1, '2019-10-29 12:31:11', '2019-10-29 13:09:09'),
