(98, 10, 11, 'Optimeal Privilege Low Grain Small Breeds Puppies сухой корм с ягненком для щенков мини и малых пород', 'optimeal-privilege-low-grain-small-breeds-puppies-sukhoy-korm-s-yagnenkom-dlya-shchenkov-mini-i-malykh-porod', '<p>Низкозерновой полнорационный корм с высоким содержанием мяса ягненка для щенков малых и миниатюрных пород.</p>', 155.00, NULL, '650 гр.', 31, 1, '/photos/shares/5db855efd7338.jpg', 1, '2019-10-29 13:08:57', '2019-10-29 13:09:02'),
(99, 10, 11, 'Optimeal Puppies All Breeds сухой корм с индейкой для щенков всех пород', 'optimeal-puppies-all-breeds-sukhoy-korm-s-indeykoy-dlya-shchenkov-vsekh-porod', '<p>Полноценный сухой корм для щенков всех пород на основе мяса индейки. Содержит натуральный белок в виде отборных мясных ингредиентов, что позволяет удовлетворить потребности растущего организма. Также в состав входит необычный и свежий ягодно-травяной микс, который является идеальным инструментом для укрепления иммунитета. Присутствуют пребиотики, позволяющие нормализовать и восстановить микрофлору кишечника.</p>', 554.00, NULL, '4 кг.', 13, 1, '/photos/shares/5db855efd8c65.jpg', 1, '2019-10-29 13:10:13', '2019-10-29 13:10:22'),
(100, 10, 11, 'Optimeal Privilege Grain Free Small Breeds Adult Dog беззерновой сухой корм с ягненком для взрослых собак мини и малых пород', 'optimeal-privilege-grain-free-small-breeds-adult-dog-bezzernovoy-sukhoy-korm-s-yagnenkom-dlya-vzroslykh-sobak-mini-i-malykh-porod', '<p>Беззерновой полнорационный корм с мясом ягненка для взрослых собак малых и миниатюрных пород.</p>', 290.00, NULL, '1,5 кг.', 19, 1, '/photos/shares/5db855f01a65a.jpeg', 0, '2019-10-29 13:11:53', '2019-10-29 13:13:16'),
(101, 10, 11, 'Optimeal Dog Adult Small сухой корм с уткой для взрослых собак мини и малых пород', 'optimeal-dog-adult-small-sukhoy-korm-s-utkoy-dlya-vzroslykh-sobak-mini-i-malykh-porod', '<p>Полноценный сухой корм для взрослых собак мелких пород (весом от 1 до 10 кг и возрастом от 1 и до 7 лет). Содержит все необходимые для собачьего организма мясные ингредиенты, растительные составляющие в виде кукурузы и кукурузного глютена, рис, семена льна, корень алтея, цветы ромашки, чабрец. Содержит пребиотики, нормализующие микрофлору желудка и кишечника, витамины и минералы.</p>', 562.00, NULL, '4 кг.', 24, 1, '/photos/shares/5db855efe6dde.png', 1, '2019-10-29 13:12:56', '2019-10-29 13:12:56'),
(102, 25, 11, 'Optimeal Kittens Сухой корм с курицей для котят', 'optimeal-kittens-sukhoy-korm-s-kuritsey-dlya-kotyat', '<p>Полнорационный сухой корм для котят (от 8 до 40 недель) с курицей. Корм&nbsp;для котят содержит оптимальное количество мяса курицы, жиров, витаминов, трав, гарантируя крепкий иммунитет и максимум сил для активного роста.</p>', 31.00, NULL, '600 гр.', 13, 1, '/photos/shares/5db857b6733ed.jpg', 0, '2019-10-29 13:16:53', '2019-10-29 13:16:53'),
(103, 25, 11, 'Optimeal Chicken Сухой корм с курицей для взрослых кошек', 'optimeal-chicken-sukhoy-korm-s-kuritsey-dlya-vzroslykh-koshek', '<p>Полнорационный сухой корм для взрослых кошек с курицей. Корм для содержит богатое белком мясо курицы, пребиотики и уникальный микс целебных трав: женьшеня, корня алтея и чабреца. Белки - 34 гр/100гр, жиры - 16 гр/100 гр.</p>', 126.00, NULL, '650 гр.', 26, 1, '/photos/shares/5db857b62046a.jpg', 0, '2019-10-29 13:18:05', '2019-10-29 13:18:05'),
(104, 25, 11, 'Optimeal High in Veal Сухой корм с телятиной для взрослых кошек', 'optimeal-high-in-veal-sukhoy-korm-s-telyatinoy-dlya-vzroslykh-koshek', '<p>Полнорационный сухой корм для взрослых кошек с высоким содержанием телятины.&nbsp;Корм для содержит мясо телятины, пребиотики и уникальный микс целебных трав: корня лопуха, корня алтея, цветы ромашки, крапива и чабреца. Белки - 34 гр/100гр, масла и жиры - 16 гр/100 гр.</p>', 618.00, 630.00, '4 кг.', 35, 1, '/photos/shares/5db857b630e76.jpg', 1, '2019-10-29 13:19:04', '2019-10-29 13:19:04'),
(105, 25, 11, 'Optimeal DUCK Hairball Control Сухой шерстевыводящий корм с уткой для взрослых кошек', 'optimeal-duck-hairball-control-sukhoy-sherstevyvodyashchiy-korm-s-utkoy-dlya-vzroslykh-koshek', '<p>Полнорационный сухой корм для взрослых кошек с эффектом выведения шерсти на основе мяса утки.&nbsp;Рекомендуется для кошек всех пород.</p>', 68.00, NULL, '300 гр.', 36, 1, '/photos/shares/5db857b63f6d8.jpg', 1, '2019-10-29 13:21:58', '2019-10-29 13:21:58'),
(106, 25, 11, 'Optimeal for Carnivores Duck & Vegetables Сухой беззерновой корм Утка и овощи для кошек', 'optimeal-for-carnivores-duck-vegetables-sukhoy-bezzernovoy-korm-utka-i-ovoshchi-dlya-koshek', '<p>Беззерновой полнорационный сухой корм для взрослых кошек (в возрасте от 1 до 7 лет) с мясом утки и овощами. Усовершенствованная формула для поддержания иммунитета. Подходит для кошек с чувствительным пищеварением.</p>', 700.00, NULL, '4 кг.', 11, 1, '/photos/shares/5db859c1b2e6a.jpg', 0, '2019-10-29 13:25:25', '2019-10-29 13:25:25'),
(107, 15, NULL, 'AnimАll (Энимал) VetLine антигельминтная защита для котов и собак', 'animall-enimal-vetline-antigelmintnaya-zashchita-dlya-kotov-i-sobak', '<p>Комбинированный противогельминтный препарат, обладающий широким спектром нематоцидного и цестоцидного действия на все фазы развития круглых и ленточных гельминтов, паразитирующих у собак и кошек.</p>', 5.00, NULL, 'шт.', 30, 1, '/photos/shares/5db85ae26d732.jpeg', 0, '2019-10-29 13:30:24', '2019-10-29 13:31:19');
