(108, 15, 20, 'Бихелдон (Biheldon) комбинированный антигельминтик для собак и кошек, со вкусом мяса', 'bikheldon-biheldon-kombinirovannyy-antigelmintik-dlya-sobak-i-koshek-so-vkusom-myasa', '<p>Бихелдон (Biheldon) - универсальный антигельминтик широкого спектра действия, одна таблетка на 10 кг веса животного.&nbsp;Препарат действующий одновременно на молодые и взрослые формы тений и нематодов, которыми могут быть заражены собаки и кошки. А вкус мяса позволит животному принять лекарство беспроблемно.</p>', 7.00, NULL, 'шт.', 30, 1, '/photos/shares/5db85cb46ef90.jpg', 0, '2019-10-29 13:39:22', '2019-10-31 13:16:08'),
(109, 15, 20, 'Энвайр для собак антигельминтное средство для собак', 'envayr-dlya-sobak-antigelmintnoe-sredstvo-dlya-sobak', '<p>Лечение круглых и ленточных гельминтов при однократном применении.</p>', 11.00, NULL, 'шт.', 45, 1, '/photos/shares/5db85dc027e9a.jpg', 0, '2019-10-29 13:42:24', '2019-10-29 13:42:24'),
(110, 15, 20, 'Drontal plus (Дронтал плюс) со вкусом говядины', 'drontal-plus-drontal-plyus-so-vkusom-govyadiny', '<p>Дронтал плюс : Drontal plus - антигельминтик широкого спектра действия для профилактики и лечения при нематодозах и цестодозах у собак (со вкусом мяса.)</p>', 38.00, NULL, 'шт.', 35, 1, '/photos/shares/5db85e3ac0dee.jpg', 0, '2019-10-29 13:44:28', '2019-10-29 13:44:28'),
(111, 15, 20, 'Празицид Плюс - сладкая суспензия для щенков мелких пород + шприц-дозатор', 'prazitsid-plyus-sladkaya-suspenziya-dlya-shchenkov-melkikh-porod-shprits-dozator', '<p>Празицид суспензия&nbsp;назначают&nbsp;щенкам мелких пород с профилактической и лечебной целью при заболеваниях, вызванных круглыми и ленточными гельминтами: нематодозы (токсокароз, токсаскаридоз, унцинариоз, анкилостомоз) и цестодозы (тениидозы, дипилидиоз, эхинококкозы, дифиллоботриоз, мезоцестоидоз).&nbsp;Флакон&nbsp;5 мл + шприц-дозатор.</p>', 47.00, NULL, '5 мл. шприц', 12, 1, '/photos/shares/5db85e9b9c956.png', 0, '2019-10-29 13:45:52', '2019-10-29 13:45:52'),
(112, 30, 20, 'Энвайр для котов™', 'envayr-dlya-kotov', '<p>Лечение круглых и ленточных гельминтов при однократном применении.&nbsp;100% эффективность при лечении смешанных гельминтозов котов при двукратном применении препарата с интервалом 14 дней</p>', 11.00, NULL, 'шт.', 25, 1, '/photos/shares/5db85f76c3266.jpg', 0, '2019-10-29 13:49:39', '2019-10-29 13:49:39'),
(113, 30, 20, 'Дронтал (Drontal) для кошек', 'drontal-drontal-dlya-koshek', '<table cellspacing=\"5\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Дронтал для кошек - антигельминтик широкого спектра действия для профилактики и лечения при нематодозах и цестодозах у котят и кошек.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 28.00, NULL, 'шт.', 36, 1, '/photos/shares/5db85f76ccf8e.jpg', 0, '2019-10-29 13:50:36', '2019-10-29 13:50:36'),
(114, 30, 20, 'Caniquantel Plus (Каниквантел Плюс) антигельминтик широкого спектра действия с ароматом мяса', 'caniquantel-plus-kanikvantel-plyus-antigelmintik-shirokogo-spektra-deystviya-s-aromatom-myasa', '<p>Оптимальное соотношение двух действующих веществ обеспечивает самый широкий спектр действия антигельминтного препарата. Препарат высоко эффективен против нематод желудочно-кишечного тракта и легких, а также на цестод. Эффективный против имагинальных и ларвальных стадий паразитов.</p>', 38.00, NULL, 'шт.', 36, 1, '/photos/shares/5db8600a80767.jpg', 0, '2019-10-29 13:51:58', '2019-10-29 13:51:58'),
(115, 30, 20, 'ПРАЗИЦИД Плюс - сладкая антигельминтная суспензия для котят', 'prazitsid-plyus-sladkaya-antigelmintnaya-suspenziya-dlya-kotyat', '<p>Препарат назначают котятам с профилактической и лечебной целью при заболеваниях, вызванных круглыми и ленточными гельминтами: нематодозы (токсокароз, токсаскаридоз, унцинариоз, анкилостомоз) и цестодозы (тениидозы, дипилидиоз, эхинококкозы, дифиллоботриоз, мезоцестоидоз).</p>', 47.00, NULL, '5 мл. суспензия', 14, 1, '/photos/shares/5db85f76c9f30.png', 0, '2019-10-29 13:52:51', '2019-10-29 13:55:19'),
(117, 30, 20, 'ПРАЗИЦИД Плюс - сладкая антигельминтная суспензия для кошек', 'prazitsid-plyus-sladkaya-antigelmintnaya-suspenziya-dlya-koshek', '<p>Антигельминтная суспензия широкого спектра действия для лечения и профилактики болезней, вызванных круглыми и ленточными гельминтами у кошек. Объем - 7 мл.</p>', 47.00, NULL, 'флакон 7 мл', 12, 1, '/photos/shares/5db85f7707d00.png', 0, '2019-10-29 13:54:27', '2019-10-29 13:54:27'),
(118, 30, 20, 'Дирофен для котят и щенков', 'dirofen-dlya-kotyat-i-shchenkov', '<p>&nbsp;</p>\r\n\r\n<p>Дирофен представляет собой антигельминтный препарат широкого спектра действия для лечения и профилактики болезней, вызванных нематодами и цестодами у котят и щенков. В состав входят пирантел, фенбендазол и наполнители.</p>\r\n\r\n<p>Упаковка: 6 таблеток</p>', 49.00, NULL, 'упаковка, 6 табл.', 0, 1, '/photos/shares/5db85f76c1cc3.jpg', 0, '2019-10-29 13:56:39', '2019-10-29 13:56:39'),
(119, 25, 12, 'Сухой корм  Orijen Cat & Kitten 40/20 для пожилых кошек', 'sukhoy-korm-orijen-cat-kitten-4020-dlya-pozhilykh-koshek', '<p>Биологически соответствующий сухой корм, богатый разными видами мяса с добавлением небольшого количества фруктов, овощей и лекарственных трав для кошек и котят всех пород. Ингредиенты в составе корма Orijen находятся в биологически соответствующем соотношении 85% мяса, 15% фруктов и овощей, 0% злаков.</p>', 253.00, NULL, '340 гр.', 26, 1, '/photos/shares/5db8622c4b75d.jpg', 0, '2019-10-29 14:00:59', '2019-10-29 14:00:59'),
(120, 10, 12, 'Orijen Adult 6 Fish гипоаллергенный сухой корм холистик для взрослых собак', 'orijen-adult-6-fish-gipoallergennyy-sukhoy-korm-kholistik-dlya-vzroslykh-sobak', '<p>Корм ORIJEN 6 FISH для взрослых собак полон гипоаллергенными высокоусвояемыми протеинами из одного источника - мяса рыбы (70%), выловленной в природных водоемах, включая свежего лосося, северного озерного сига, северного судака, озерную форель, налима и свежую сельдь для оптимального питания Вашей собаки.</p>', 196.00, NULL, '340 гр.', 12, 1, '/photos/shares/5db8629f0096b.jpg', 0, '2019-10-29 14:03:10', '2019-10-29 14:03:10'),
(121, 10, 12, 'Orijen Puppy биологический сухой корм холистик для щенков всех пород', 'orijen-puppy-biologicheskiy-sukhoy-korm-kholistik-dlya-shchenkov-vsekh-porod', '<p>Биологически соответствующий корм ORIJEN PUPPY обеспечивает естественное питание для щенков всех пород и размеров. Этот рацион с высоким содержанием белков и низким содержанием углеводов отображает первоначальный собачий рацион питания и естественным образом утоляет голод &ndash; поэтому ожидайте меньшего потребления этого корма, в сравнении с традиционным.</p>', 889.00, NULL, '2 кг.', 14, 1, '/photos/shares/5db8629ef1694.jpg', 0, '2019-10-29 14:04:56', '2019-10-29 14:04:56'),
(122, 10, 12, 'Orijen Puppy Large биологический сухой корм холистик для щенков крупных пород', 'orijen-puppy-large-biologicheskiy-sukhoy-korm-kholistik-dlya-shchenkov-krupnykh-porod', '<p>Биологически соответствующий&nbsp;<em>корм ORIJEN PUPPY</em>&nbsp;обеспечивает естественное питание для&nbsp;<em>щенков</em>&nbsp;всех пород и размеров. Этот рацион с высоким содержанием белков и низким содержанием углеводов отображает первоначальный собачий рацион питания и естественным образом утоляет голод &ndash; поэтому ожидайте меньшего потребления этого корма, в сравнении с традиционным.</p>', 3049.00, NULL, '11,4 кг.', 0, 1, '/photos/shares/5db863f5852d6.png', 0, '2019-10-29 14:08:37', '2019-10-29 14:08:37'),
(123, 25, 12, 'ORIJEN CAT & KITTEN биологический сухой корм холистик для кошек для котят всех пород и возрастов', 'orijen-cat-kitten-biologicheskiy-sukhoy-korm-kholistik-dlya-koshek-dlya-kotyat-vsekh-porod-i-vozrastov', '<p>Имея наиболее высокое содержание свежего мяса цыплят, вскормленных зерном, свежевыловленного сига из северных озер и свежих цельных яиц, каждая гранула&nbsp;<em>корма Ориджен для кошек</em>&nbsp;буквально переполнена белками из мяса (минимум 75%) пригодного для употребления в пищу человеком, и не содержит зерновых и углеводов, биологически неподходящих для питания котов.</p>', 233.00, NULL, '340 гр.', 3, 1, '/photos/shares/5db863f56b661.png', 0, '2019-10-29 14:10:19', '2019-10-29 14:10:19'),
(124, 25, 12, 'ORIJEN CAT&KITTEN 6 FISH гипоаллергенный биологический сухой корм холистик для кошек для котят всех пород и возрастов', 'orijen-catkitten-6-fish-gipoallergennyy-biologicheskiy-sukhoy-korm-kholistik-dlya-koshek-dlya-kotyat-vsekh-porod-i-vozrastov', '<p><em>Корм Orijen 6 Fish для кошек</em>&nbsp;и котят полон гипоаллергенными высокоусвояемыми протеинами из одного источника - мяса рыбы (75%), выловленной в природных водоемах, включая свежего лосося, северного озерного сига, северного судака, озерную форель, налима и свежую сельдь, 25% водорослей, фруктов и овощей, 0% зерна&nbsp;для оптимального питания Вашей кошки.</p>', 2300.00, 2329.00, '5 кг.', 5, 1, '/photos/shares/5db86536d18ea.png', 0, '2019-10-29 14:14:07', '2019-10-29 14:14:07'),
(125, 10, 12, 'Orijen Senior сухой корм холистик для пожилых стареющих собак', 'orijen-senior-sukhoy-korm-kholistik-dlya-pozhilykh-stareyushchikh-sobak', '<table cellspacing=\"5\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><em>Корм ORIJEN SENIOR</em>&nbsp;имеет высокое содержание свежего мяса цыплят, вскормленных зерном, свежего сига из северных озер и свежих цельных яиц, что обеспечивает высокий уровень протеина, необходимого стареющим собакам. Для удовлетворения жизненных потребностей Вашей стареющей собаки каждая гранула корма ORIJEN буквально переполнена белками из мяса (минимум 75%) пригодного для употребления в пищу человеком и не содержит зерновых и углеводов, вредных для ее здоровья.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 882.00, NULL, '2 кг.', 30, 1, '/photos/shares/5db8661fd1659.png', 0, '2019-10-29 14:17:57', '2019-10-29 14:17:57'),
(126, 25, 12, 'Orijen Fit & Trim Сухой корм для кошек с лишним весом', 'orijen-fit-trim-sukhoy-korm-dlya-koshek-s-lishnim-vesom', '<p>Сухой корм для кошек с лишним весом. 85% мяса 15% овощи и фрукты. Для отменной физической формы, высокопротеиновые рационы с умеренным количеством жира и ограниченным количеством углеводов.</p>', 2202.00, NULL, '5,4 кг.', 2, 1, '/photos/shares/5db86691ab6d0.png', 0, '2019-10-29 14:19:48', '2019-10-29 14:19:48'),
(127, 15, 9, 'Bayer Advantix капли от блох и клещей для собак от 40 до 60 кг.', 'bayer-advantix-kapli-ot-blokh-i-kleshchey-dlya-sobak-ot-40-do-60-kg', '<p>Bayer Advantix &ndash; это эффективное средство для защиты от клещей, блох, комаров и москитов. На клещей данный препарат влияет особенно, так как его сильное репеллентное действие эффективно отпугивает иксодовых клещей, не давая больше возможности паразитам попасть на собаку в течение месяца.&nbsp;<strong>Средство способно моментально уничтожить клещей</strong>, которые при прогулке с собакой атакуют ее. Стоит заметить, что компоненты препарата позволяют бороться с паразитами еще до укуса. При этом до минимума снижается риск заражения собаки кровепаразитарными заболеваниями.Средство Bayer Advantix уничтожает близко 98-100%&nbsp; блох, которые паратизируют на домашнем питомце и всего за половину суток, после обработки препаратом. Также лекарственный&nbsp;<strong>препарат защищает в случае повторного нападения паразитов</strong>&nbsp;на срок до 30 дней. Блохи на собаке умирают еще до укуса, как и личинки в местах обитания. Препарат также подойдет для уничтожения вшей и власоедов.</p>\r\n\r\n<p>Эффективно средство уничтожает и предотвращает воздействие на собак комаров и москитов. После обработки питомца препаратом, оно способно отпугивать паразитов в течение 4-недель, снижая максимально риск различных заболеваний.&nbsp;<strong>Средство, попадая на кожу собаки, не проникает в кровь,</strong>&nbsp;поэтому является безопасным для здоровья собак. Использовать капли Bayer Advantix можно, как взрослым особям, так и щенкам самых разных пород.</p>\r\n\r\n<p>Одной упаковки препарата хватит на периодическое&nbsp; использование в течение 4 месяцев. Капли оказывают защитное действие уже после первой обработки животного, и является сильнодействующим. Однако если обратить внимание на степень токсического воздействия на организм, то препарат стоит отнести к умеренно-опасным химическим веществам.&nbsp;<strong>Собаки отлично переносят обработку данным препаратом</strong>, даже в дозе, которая превышает в пять раз терапевтический эффект.</p>\r\n\r\n<p>При работе с препаратом стоит прочитать инструкцию относительно того, как вести себя с препаратом и возможные случаи, и их решения. Это стоит сделать не только для собаки, но и для себя, ведь попав не на тот участок тела человека, препарат может стать поистине губительным.</p>\r\n\r\n<p><strong>Состав:</strong>&nbsp;10 % имидаклоприда и 50 % перметрина; вспомагательные компоненты</p>\r\n\r\n<p><strong>Производитель:</strong>&nbsp;Bayer, Германия</p>', 248.00, 260.00, '1 пипетка по 2 мл.', 10, 1, '/photos/shares/5dbada1a1684f.jpg', 1, '2019-10-31 10:57:35', '2019-10-31 11:38:58'),
(128, 15, 9, 'Bayer Advantix капли от блох и клещей для собак до 4 кг.', 'bayer-advantix-kapli-ot-blokh-i-kleshchey-dlya-sobak-do-4-kg', '<p>Капли против блох Advantix для собак до 4кг.&nbsp;<br />\r\nАдвантикс&reg; &mdash; эффективная защита от клещей:<br />\r\nСильное репеллентное действие &mdash; отпугивает иксодовых клещей от вашей собаки и препятствует нападению паразита на животное в течение 4 недель<br />\r\nБлагодаря контактному действию, моментально убивает клещей, попавших на животное, до укуса<br />\r\nСнижает риск поражения собаки кровепаразитарными заболеваниями.<br />\r\nАдвантикс&reg; &mdash; эффективное средство против блох:<br />\r\nУничтожает 98-100% блох, паразитирующих на животном, в течение 12 часов после обработки<br />\r\nЗащищает от повторного нападения в течение 30 дней<br />\r\nУбивает блох до укуса<br />\r\nУничтожает личинки блох в местах обитания животных<br />\r\nЭффективен против вшей и власоедов<br />\r\nАдвантикс&reg; &mdash; эффективное средство против комаров и москитов:<br />\r\nОтпугивает комаров и москитов в течение 4-х недель после обработки<br />\r\nСнижает риск заболевания лейшманиозом и дирофиляриозом<br />\r\nАдвантикс&reg; &mdash; безопасное средство:<br />\r\nНе всасывается в кровь<br />\r\nВ рекомендуемых дозах не оказывает побочных действий<br />\r\nМожно применять щенкам и собакам разных пород, возрастов<br />\r\nБезопасен для людей<br />\r\nАдвантикс&reg; &mdash; длительное действие:<br />\r\nДействует в течение 4-х недель<br />\r\nОдной упаковки хватает на 4 месяца<br />\r\nПри попадании собаки в водную среду эффективность препарата не снижается (при купании собаки с шампунем следует учитывать снижение эффективности препарата на 1-2 дня).<br />\r\n<br />\r\n&nbsp;</p>', 160.00, 170.00, '1 пипетка по 0,4 мл.', 15, 1, '/photos/shares/5dbadbf1b10a5.jpg', 0, '2019-10-31 11:05:47', '2019-10-31 11:35:25'),
(129, 15, 9, 'Bayer Advantix капли от блох и клещей для собак от 4 до 10 кг.', 'bayer-advantix-kapli-ot-blokh-i-kleshchey-dlya-sobak-ot-4-do-10-kg', '<p>Капли против блох Advantix для собак свыше от 4 до 10кг. Адвантикс&reg; &mdash; эффективная защита от клещей: Сильное репеллентное действие &mdash; отпугивает иксодовых клещей от вашей собаки и препятствует нападению паразита на животное в течение 4 недель Благодаря контактному действию, моментально убивает клещей, попавших на животное, до укуса Снижает риск поражения собаки кровепаразитарными заболеваниями Адвантикс&reg; &mdash; эффективное средство против блох: Уничтожает 98-100% блох, паразитирующих на животном, в течение 12 часов после обработки Защищает от повторного нападения в течение 30 дней Убивает блох до укуса Уничтожает личинки блох в местах обитания животных Эффективен против вшей и власоедов Адвантикс&reg; &mdash; эффективное средство против комаров и москитов: Отпугивает комаров и москитов в течение 4-х недель после обработки Снижает риск заболевания лейшманиозом и дирофиляриозом Адвантикс&reg; &mdash; безопасное средство: Не всасывается в кровь В рекомендуемых дозах не оказывает побочных действий Можно применять щенкам и собакам разных пород, возрастов Безопасен для людей Адвантикс&reg; &mdash; длительное действие: Действует в течение 4-х недель Одной упаковки хватает на 4 месяца При попадании собаки в водную среду эффективность препарата не снижается (при купании собаки с шампунем следует учитывать снижение эффективности препарата на 1-2 дня). 1 пипетка по 1,0 мл.</p>', 149.00, NULL, '1 пипетка по 1 мл.', 15, 1, '/photos/shares/5dbadbf1b9f6a.jpg', 1, '2019-10-31 11:38:55', '2019-10-31 11:38:55'),
(130, 25, 13, '1st Choice Urinary Health - сухой корм диета для взрослых кошек и котов склонных к МБК (мочекаменная болезнь)', '1st-choice-urinary-health-sukhoy-korm-dieta-dlya-vzroslykh-koshek-i-kotov-sklonnykh-k-mbk-mochekamennaya-bolezn', '<p>Сухой корм 1st Choice Urinary Health ФЕСТ ЧОЙС УРИНАРИ ХЕЛС предназначен для поддержания здоровья мочевыделительной системы взрослых кошек старше 1 года.&nbsp;Сбалансированный состав корма (основной компонент &ndash; куриное мясо) делает его отличным вариантом для полноценного рациона. Корм Уринари Хэлс не только выводит шерсть из желудочно-кишечного тракта и предупреждает образование струвитов, но и оздоравливает иммунную систему, поддерживает здоровый вес питомца.</p>', 130.00, 150.00, '340 гр.', 36, 1, '/photos/shares/5dbae530ec740.jpg', 1, '2019-10-31 11:44:48', '2019-10-31 11:44:48'),
(131, 25, 13, '1st Choice Sterilized - сухой супер премиум корм для кастрированных котов и стерилизованных кошек', '1st-choice-sterilized-sukhoy-super-premium-korm-dlya-kastrirovannykh-kotov-i-sterilizovannykh-koshek', '<p>Супер премиум корм 1st Choice Sterilized ФЕСТ ЧОЙС СТЕРИЛАЙЗИД &ndash; диетическое питание, приготовленное специально для стерилизованных кошек и кастрированных котов возрастом от 1 года и старше.</p>', 722.00, 730.00, '2,4 кг.', 12, 1, '/photos/shares/5dbae5dcbbe62.jpg', 0, '2019-10-31 11:47:41', '2019-10-31 11:47:41'),
(132, 10, 13, '1st Choice Puppy Medium and Large breed - сухой корм для щенков средних и крупных пород', '1st-choice-puppy-medium-and-large-breed-sukhoy-korm-dlya-shchenkov-srednikh-i-krupnykh-porod', '<p><em>Суперпремиум корм для щенков Фест Чойс</em>&nbsp;на основе мяса курицы, предназначен как основное питание для щенков средних и крупных пород (вес взрослой собаки от 9,5 кг) в возрасте от 2 до 14 месяцев.</p>', 521.00, 550.00, '2,72 кг.', 8, 1, '/photos/shares/5dbae65aacc40.jpg', 1, '2019-10-31 11:49:53', '2019-11-02 14:27:18'),
(133, 25, 13, '1st Choice (Фест Чойс) Kitten - сухой корм для котят (с курицей)', '1st-choice-fest-choys-kitten-sukhoy-korm-dlya-kotyat-s-kuritsey', '<p><em>Супер премиум корм для котят Фест Чойс</em>&nbsp;предназначен для котят в период роста на основе мяса курицы. Корм для котят полностью адаптирован для удовлетворения специфических потребностей растущего организма котенка от отъема до 12 месяцев.</p>', 107.00, 120.00, '350 гр.', 25, 1, '/photos/shares/5dbae7083043d.jpg', 0, '2019-10-31 11:53:09', '2019-10-31 11:53:09'),
(134, 25, 13, '1st Choice Adult Hypoallergenic - сухой корм для взрослых кошек гипоаллергенная диета (с уткой и картошкой)', '1st-choice-adult-hypoallergenic-sukhoy-korm-dlya-vzroslykh-koshek-gipoallergennaya-dieta-s-utkoy-i-kartoshkoy', '<p>Супер премиум корм для котов Фест Чойс гипоаллергенный &ndash; это специально разработанная формула для взрослых котов, страдающих от пищевой аллергии.</p>', 146.00, 150.00, '350 гр.', 23, 1, '/photos/shares/5dbae7b4c71c6.jpg', 0, '2019-10-31 11:55:26', '2019-10-31 11:55:26'),
(135, 25, 13, '1st Choice Active Cat Финики - сухой корм для активных и переборчивых взрослых кошек и котов (с курицей)', '1st-choice-active-cat-finiki-sukhoy-korm-dlya-aktivnykh-i-pereborchivykh-vzroslykh-koshek-i-kotov-s-kuritsey', '<p><em>Супер премиум корм для котов Фест Чойс</em>&nbsp;на основе мяса курицы - это полноценное и сбалансированное питание для здоровой жизни активных и переборчивых котов.</p>', 669.00, 750.00, '2,72 кг.', 35, 1, '/photos/shares/5dbae7b4ee70e.jpg', 1, '2019-10-31 11:56:38', '2019-11-02 14:15:09'),
(136, 25, 13, '1st Choice Mature Cat - сухой корм для пожилых или малоактивных кошек', '1st-choice-mature-cat-sukhoy-korm-dlya-pozhilykh-ili-maloaktivnykh-koshek', '<p>Супер премиум корм для котов Фест Чойс облегченный - это полноценное и сбалансированное питание для здоровой и активной жизни неактивных, кастрированных и пожилых котов.</p>', 1139.00, NULL, '5,45 кг.', 2, 1, '/photos/shares/5dbae7b4e2884.jpg', 0, '2019-10-31 11:57:49', '2019-10-31 11:57:49'),
(137, 10, 13, '1st Choice - Fish Ad Mini - сухой корм для взрослых собак мини и мелких пород с ягненком и рыбой', '1st-choice-fish-ad-mini-sukhoy-korm-dlya-vzroslykh-sobak-mini-i-melkikh-porod-s-yagnenkom-i-ryboy', '<p>Супер премиум корм на основе мяса ягненка и рыбы для взрослых собак миниатюрных и малых пород весом до 9,5 кг в возрасте от 10 месяцев до 8 лет.</p>', 97.00, 100.00, '350 гр.', 36, 1, '/photos/shares/5dbae8cdaef43.jpg', 0, '2019-10-31 12:37:44', '2019-10-31 12:37:44'),
(138, 10, 13, '1st Choice (Фест Чойс) Fish Pup Mini сухой корм для щенков мини и мелких пород с ягненком и рыбой', '1st-choice-fest-choys-fish-pup-mini-sukhoy-korm-dlya-shchenkov-mini-i-melkikh-porod-s-yagnenkom-i-ryboy', '<p>Суперпремиум корм на основе мяса ягненка, океанической рыбы и коричневого риса для щенков мелких пород в возрасте от 2 до 10 месяцев. Содержит гипоаллергенные протеины ягненка и океанической рыбы, витамины, кальций и другие минералы для оптимального роста и развития.</p>', 566.00, NULL, '2,72 кг.', 21, 1, '/photos/shares/5dbae8e553419.jpg', 0, '2019-10-31 12:45:07', '2019-10-31 12:45:07'),
(139, 10, 13, '1st Choice (Фест Чойс) Senior 6+ Medium & Large Breed - сухой супер премиум корм для пожилых или малоактивных собак средних и крупных пород старше 6 лет (курица)', '1st-choice-fest-choys-senior-6-medium-large-breed-sukhoy-super-premium-korm-dlya-pozhilykh-ili-maloaktivnykh-sobak-srednikh-i-krupnykh-porod-starshe-6-let-kuritsa', '<p>Супер премиум корм на основе мяса курицы для пожилых собак средних и крупных пород в возрасте более 6 лет или для взрослых собак, склонных к полноте. Для поддержания здорового веса корм содержит L-карнитин, который помогает расщеплять жир.</p>', 968.00, NULL, '7 кг.', 10, 1, '/photos/shares/5dbae8cdb39c3.jpg', 1, '2019-10-31 12:45:59', '2019-10-31 18:23:58');
